import logo from './logo.svg';
import './App.css';
import { Splide, SplideSlide } from '@splidejs/react-splide';

function App() {
  return (
    <div>
      <Splide>
        <SplideSlide>
          <img src="image1.jpg" alt="Image 1" />
        </SplideSlide>
        <SplideSlide>
          <img src="image2.jpg" alt="Image 2" />
        </SplideSlide>
      </Splide>
    </div>
  );
}

export default App;
